import React from 'react';
import './App.css';
import Header from "./components/Header";
import Nav from "./components/Nav";
import MainContent from "./components/MainContent"


const App = () => {
    return (
        <div className='app-wrapper'>
           <Header />
           <Nav />
           <MainContent />
        </div>
    );
}

export default App;
